import random

def encode_b_cryptic(text: str) -> str:
    """
    Encode text to B_CRYPTIC format while:
    - Keeping encoded letters grouped together (no spaces between them).
    - Randomly selecting one of multiple encoding options (for spaces, etc.).
    - Preserving spaces between words.
    - Maintaining reversibility with decoding.
    """
    if not text:
        return ""

    result = []
    word_buffer = []  # Collect encoded characters of a word

    for char in text:
        if char == " ":
            if word_buffer:
                result.append("".join(word_buffer))  # Add encoded word without spaces
                word_buffer = []  # Reset buffer
            space_choice = random.choice(B_CRYPTIC_ENCODING_TABLE[" "])
            result.append(space_choice)
            B_CRYPTIC_DECODING_TABLE[space_choice] = " "  # Ensure space decoding matches
        elif char in B_CRYPTIC_ENCODING_TABLE:
            word_buffer.append(random.choice(B_CRYPTIC_ENCODING_TABLE[char]))  # Encode character
        else:
            word_buffer.append("[?]")  # Handle unknown characters

    if word_buffer:
        result.append("".join(word_buffer))  # Add last encoded word
    
    return "".join(result)  # No spaces between encoded characters

def decode_b_cryptic(b_cryptic_text: str) -> str:
    """
    Decode B_CRYPTIC format back to original text.
    - Handles words without spaces between encoded letters.
    - Ensures spaces are correctly mapped back.
    """
    if not b_cryptic_text:
        return ""

